import React from "react";
import LeftListStyle from "./LeftListStyle"

import CheckboxList from "../../../CheckBox/CheckBoxList"

import CardAddOrder from "../../../CardAddOrder/CardAddOrder"

class LeftList extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
          ListCard: [{
                id: 0,
                name: "Велосипед"
              },
              {
                id: 1,
                name: "Самокат"
              }]
        };
      }

      OutputList = (e) => {
        return this.state.ListCard.map((item,index) => {
          return <CardAddOrder key={item.id} Title={item.name}/>;
        })
      }


      render() {
        return (
            <LeftListStyle>
             {this.OutputList()}
                {/*<CheckboxList/>*/}
            </LeftListStyle>
        )
      }
}


export default LeftList;
